import React from 'react';
import { Link, animateScroll as scroll } from "react-scroll";

const SmallNav = () => {
	return ( 
	<nav className='nav-items' id='nav-wrapper' style={{"borderBottom": "0px solid red", "transition": "0.2s ease"}}>
				<div className="home-box">
					<Link activeClass="active"
				      to="home-page"
				      spy={true}
				      smooth={true}
				      offset={-60}
				      duration={500}>
						<p className="nav-item" id="nav-home">Home</p>
					</Link>
				</div>
				<div className="menu-box">
					<Link activeClass="active"
				      to="about-page"
				      spy={true}
				      smooth={true}
				      offset={-60}
				      duration={500}>
						<p className="nav-item" id="nav-skills">About</p>
					</Link>
					<Link activeClass="active"
				      to="skills-page"
				      spy={true}
				      smooth={true}
				      offset={-60}
				      duration={500}>
						<p className="nav-item" id="nav-skills">Skills</p>
					</Link>
					<Link activeClass="active"
				      to="projects-page"
				      spy={true}
				      smooth={true}
				      offset={-60}
				      duration={500}>
						<p className="nav-item" id="nav-projects">Projects</p>
					</Link>
					<Link activeClass="active"
				      to="contact-page"
				      spy={true}
				      smooth={true}
				      offset={-60}
				      duration={500}>
						<p className="nav-item" id="nav-contact"style={{'marginRight': '0px',}}>Contact</p>
					</Link>
				</div>
				<p className="nav-item navbar-icon" onClick={this.shrinkMenu}>BOOP</p>
			</nav>
	)
};

export default SmallNav;
